import BootstrapTable from 'react-bootstrap-table-next';
import paginationFactory from 'react-bootstrap-table2-paginator';

const products = ["Party in the USA", "Burnin Up", "Tik Tok", "Fireflies", "Dynamite", "Cooler than Me", "Toxic", "If U Seek Amy", "Umbrella"]
const columns = [{
  dataField: 'id',
  text: 'Songs'
}];

// export default () =>
//   <BootstrapTable keyField='id' data={ products } columns={ columns } pagination={ paginationFactory() } />

export default <BootstrapTable keyField='id' data={ products } columns={ columns } pagination={ paginationFactory() } />
